pub enum Code {

    /// BLAKE2b-256 (32-byte hash size)
    #[mh(code = 0xb220, hasher = multihash :: Blake2b256, digest = multihash
         :: Blake2bDigest < U32 >)]
    Blake2b256,

    /// Identity multihash (max 32 bytes)
    #[mh(code = 0x00, hasher = multihash :: IdentityHasher :: < U32 >, digest
         = multihash :: IdentityDigest < U32 >)]
    Identity,
}
